import React from 'react';
import ChartistGraph from 'react-chartist';
import Card from "../Card/Card"
import CardBody from "components/Card/CardBody.js";
import CardHeader from "components/Card/CardHeader.js";
import {
    lightlevels1,
    humiditylevels1,
    waterlevels1,
} from "variables/charts.js";

function HydroStat(props) {
    const { title, data1, data2, data3 } = props;
    return (
        <Card chart>
            <CardBody>
                <CardHeader>
                    <h4>{title}</h4>
                </CardHeader>
                <p>{data1}</p>
                <p>{data2}</p>
                <p>{data3}</p>


            </CardBody>
        </Card>
    )
}

export default function HydroSidebar() {
    return (
        <div
            style={{
                backgroundColor: "green",
                border: "none",
                position: "fixed",
                top: "0",
                bottom: "0",
                left: "0",
                width: "15vw",
            }}

        >
            <HydroStat title="Aeroponic 1" data1={"Light level%: " + lightlevels1.data.series[0][lightlevels1.data.series[0].length - 1]} data2={"Humidity level%: " + humiditylevels1.data.series[0][humiditylevels1.data.series[0].length - 1]} data3={"Water level (cm): " + waterlevels1.data.series[0][waterlevels1.data.series[0].length - 1]} />
            <HydroStat title="Aeroponic 2" data1={"Light level%: " + lightlevels2.data.series[0][lightlevels2.data.series[0].length - 1]} data2={"Humidity level%: " + humiditylevels2.data.series[0][humiditylevels2.data.series[0].length - 1]} data3={"Water level (cm): " + waterlevels2.data.series[0][waterlevels1.data.series[0].length - 1]} />
            <HydroStat title="Aeroponic 3" />

        </div>
    );
}
